function Header () {
    return (
        <header className="header">
            <div className="header_logo">
                <img src="https://www.weluck.vn/img/logo-weluck-dark.07935499.png"></img>
            </div>
            <div className="header_nav">
                <ul className="header_nav_list">
                    <li className="header_nav_item"></li>
                </ul>
            </div>
        </header>
    )
}

export default Header;
